import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

export default function WalletsList(props){

  const displayWallets = (props) => {
    const {wallets} = props;
    if (wallets.length > 0){
      return(
            <TableContainer>
          <Table sx={{ minWidth: 650 }} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell>Wallet</TableCell>
                <TableCell align="right">Address</TableCell>
                <TableCell align="right">Balance</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
            {
              wallets.map((wallet) => {
                console.log(wallet);
                if(wallet.assets.length > 0){
                  return(
                    <TableRow
                      key={wallet.walletID}
                      sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                      <TableCell component="th" scope="row">
                        {wallet.walletName}
                      </TableCell>
                      <TableCell align="right">{wallet.depositAddress.address}</TableCell>
                      <TableCell align="right">{wallet.assets[0].totalBalance.quantity}</TableCell>
                  </TableRow>
                  )
                }
              })
            }
            </TableBody>
          </Table>
        </TableContainer>
      )
    } else {
      return (<div>loading..</div>)
    }
  }

  return(
    <>
      {displayWallets(props)}
    </>
  )
};

